import "./Projects.css";
import Project from "./Project";
import BumoIcon from './Bumo.io.png';

function Projects() {
    return (
        <div className="Projects">
            <h1>Projects</h1>
            <Project 
            title={"Bumo.io"}
            description={"An engaging web game where players across networks attempt to knock each other out of the map and gain as much mass as possible. Includes physically accurate collisions coded from scratch, and a Node.js backend."}
            tags={["Javscript", "Node.js", "WebSockets", "Physics"]}/>
        </div>
    );
}

export default Projects;
